import React from "react";
import Style from "../Style/Style.css";


const ActusLink = () => {
  return (
    <NavLink to="/about" className="nav-link-actus">
      <li className="nav-item">Actus</li>
    </NavLink>
  );
};


const Navigation = () => {
  return (
    <div className="navigation">
      <ul>
        <ActusLink />
      </ul>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <Navigation />
    </div>
  );
};

export default About;
